import 'package:flutter/foundation.dart';

void main() {
  print(Betukereso.ListOfWordsBy('Ki#ta-l\u00E1l \u00F3s\u017Ddi!'));
}

class AppModel extends ChangeNotifier {
  String _letters;
  final List<String> _words = [];

  String get letters => _letters;
  set letters(String newLetters) {
    assert(newLetters != null);
    _letters = newLetters;
    notifyListeners();
  }

  List<String> get words => _words;
  set words(List<String> newWords) {
    _words.clear();
    _words.addAll(newWords);
    notifyListeners();
  }

  @override
  String toString() {
    return '${letters} -> ${words.length}';
  }
}

class Betukereso {

  static List<String> ListOfWordsBy(String letters) {
    List<String> result = [];
    if (letters == null) letters = "";
    final cleanLetters = letters.toLowerCase().replaceAll(RegExp(r'[^a-z\u00E1\u00E9\u00ED\u00F3\u00F6\u0151\u00FA\u00FC\u0171]'), '');
    print(cleanLetters);
    Betukereso.HunWords.forEach((hunWord) {
      final score = getScore(cleanLetters, hunWord);
      if (score > 0) {
        print('Match: ${hunWord} with score of ${score}');
        result.add('${score.toString().padLeft(3, '0')} - ${hunWord}');
      } else {
        //print('No match: ${hunWord}');
      }
    });
    result.sort((a, b) => a.compareTo(b));
    return result.map<String>((e) => e.substring(e.indexOf('-')+2)).toList();
  }

  static int getScore(String letters, String hunWord) {
    var letterPool = letters;
    for (final hunLetter in hunWord.codeUnits) {
      final hunLetterPosition = letterPool.codeUnits.indexOf(hunLetter);
      if (hunLetterPosition < 0) {
        return 0;
      }
      final before = letterPool.substring(0,hunLetterPosition);
      final after = letterPool.substring(hunLetterPosition+1);
      //print('Remove ${hunLetterPosition}. character (${String.fromCharCode(letterPool.codeUnits[hunLetterPosition])}) from ${letterPool} : ${before}+${after}');
      letterPool = before+after;
    };
    return letterPool.length;
  }

